import React from 'react';
import { Container, Row } from 'react-bootstrap';
import ActionTracker from './ActionTracker';
import './ActionTracker.scss'

const App = () => {
  return (
    <Container>
      <h1 className="bg-secondary text-white p-5 font-weight-bold">SHMCAP Action Tracker</h1>
      <Row>
        <ActionTracker />
      </Row>
    </Container>
  );
}

export default App;
